import React from 'react';
import './registro.css';

const Formulario = () => {
  return (
    <form className="formulario">
      <h1>Registrate</h1>
      <div className="contenedor">
        <div className="input-contenedor">
          <i className="fas fa-user icon"></i>
          <input type="text" id="nombreCompleto" placeholder="Nombre Completo" />
        </div>
        <div className="input-contenedor">
          <i className="fas fa-envelope icon"></i>
          <input type="text" id="correoElectronico" placeholder="Correo Electrónico" />
        </div>
        <div className="input-contenedor">
          <i className="fas fa-key icon"></i>
          <input type="password" id="contrasena" placeholder="Contraseña" />
        </div>
        <input type="submit" value="Registrate" className="button" />
        <p>Al Registrarte, aceptas nuestras Condiciones de uso y Políticas de privacidad.</p>
      </div>
    </form>
  );
};

export default Formulario;
